 Insert Into BI_RPT__DTS__ClavesSSA__CB (  Consecutivo, IdEstado, IdCliente, IdSubCliente, ClaveSSA, ClaveSSA_Mascara, NombreGenerico, Presentacion )  Values ( 856, '11', '0002', '0006', '060.345.3127', '060.345.3127', 'Sistema  de  succión,  cerrado,  para  paciente,  con  tubo endotraqueal conectado a ventilador, 12 Fr, contiene: Un  tubo  de  succión de  cloruro  de  polivinilo,  con  marca de  profundidad  de  2  cm,  empezando  desde  los 10  cm, hasta  42 cm y una marca tope. Dos orificios laterales en la  punta proximal  del  tubo,  envuelto en  una camisa  de polietileno transparente, ensamblada a una pieza en forma de T o L transparente,con puerto para irrigación, con  conexiones laterales cónicas, con entrada macho de 15 a 16 mm de diámetro externo y una conexión cónica con entrada hembra de 15 mm. de diámetro interno en la parte central, en su extremo distal se  encuentra  ensamblada  la  válvula  para  controlar  la succión, con conexión estriada universal. Incluye etiqueta de identificación para control. Estéril y desechable.', '' )   
