 Insert Into BI_RPT__DTS__ClavesSSA__CB (  Consecutivo, IdEstado, IdCliente, IdSubCliente, ClaveSSA, ClaveSSA_Mascara, NombreGenerico, Presentacion )  Values ( 860, '11', '0002', '0006', '060.345.3176', '060.345.3176', 'Sistema  de  succión,  cerrado,  para  paciente,  con  traqueostomía conectado a ventilador, 16Fr, contiene: Un  tubo  de  succión de  cloruro  de  polivinilo,  de 30.5cm. de largo, marca tope a 4.5 cm. Dos orificios laterales en la  punta proximal  del  tubo,  envuelto en  una camisa  de polietileno transparente, ensamblada a una pieza en forma de T  transparente, con puerto para irrigación,  conexiones laterales cónicas, con entrada macho de 22 mm de diámetro externo y una conexión cónica con entrada hembra de 16 mm. de diámetro interno en la parte central, en su extremo distal se  encuentra  ensamblada  la  válvula  para  controlar  la succión, con conexión estriada universal. Incluye  conector de  tubo corrugado, conector giratorio  y etiqueta de identificación para control. Estéril y desechable.', '' )   
 Insert Into BI_RPT__DTS__ClavesSSA__CB (  Consecutivo, IdEstado, IdCliente, IdSubCliente, ClaveSSA, ClaveSSA_Mascara, NombreGenerico, Presentacion )  Values ( 864, '11', '0002', '0006', '060.345.4265', '060.345.4265', 'Equipo  para  venoclisis  con  regulador  de infusión. Consta de: bayoneta con protector, conector luer lock, rosca con protector,  filtro de  aire,  cámara  de  goteo, regulador de  flujo  con  mecanismo  para  ajustar  el flujo a velocidades calibradas o estandarizadas, tubo transportador, obturador del tubo transportador;  dispositivo para aplicación de medicamentos en "Y". Longitud total 210 cm. Regulación del flujo: 50 o menor a 250 mL/h. Estéril y desechable. 60 gotas/mL.', '' )   
 Insert Into BI_RPT__DTS__ClavesSSA__CB (  Consecutivo, IdEstado, IdCliente, IdSubCliente, ClaveSSA, ClaveSSA_Mascara, NombreGenerico, Presentacion )  Values ( 865, '11', '0002', '0006', '060.345.4299', '060.345.4299', 'EQUIPO PARA ANESTESIA GENERAL, Consta de: 1 Mascarilla para anestesia para Adulto con colchón inflable. 1 Bolsa de respiración de 3 litros, diámetro interno de 22 mm. 1 Llave de tres vías con tubo de extensión de 80 cm. 1 Circuito respiratorio, consta de: Dos mangueras de 180 cm. Filtro de 0.2 micras. Conexión "Codo Y" con sistema detector de desacople, compuesto por una señal luminosa y otra audible que indica el desacople entre los conectores del "Codo Y" y la cánula endotraqueal, el "Codo Y" contiene un sello interno para evitar fugas entre los conectores del "Codo Y" y la cánula endotraqueal. 5 Electrodos ECG para adulto con broche estándar. 1 Par guantes de látex medianos. 1 Sujetador de cánula con guía para sonda gástrica consta de: Una pieza hembra dentada para recibir una pieza macho dentada. Una pieza macho dentada para sostener la cánula mediante un ajuste graduado a la pieza hembra. Una banda para sostener alrededor de la cabeza del paciente el sujetador de cánula. 1 Campo trabajo, de 50 x 66 cm. 1 Jeringa de plástico 20 ml. 3 Jeringas de plástico 10 ml. 4 Agujas hipodérmicas 21 G x 38 mm. 1 Cánula tipo yankauer, atraumática con control. 1 Cánula orofaríngea de plástico tipo Guedel No. 4 Long. 90 mm. 1 Hoja para laringoscopio Mc Intoch No. 3, adulto, con iluminación. Estéril y Desechable.', '' )   
 Insert Into BI_RPT__DTS__ClavesSSA__CB (  Consecutivo, IdEstado, IdCliente, IdSubCliente, ClaveSSA, ClaveSSA_Mascara, NombreGenerico, Presentacion )  Values ( 866, '11', '0002', '0006', '060.354.0014', '060.354.0014', 'Espátula De Ayre modificada, de madera inastillable. Instrumento alargado con dos diferentes extremos. Dimensiones: Largo total Ancho Grosor Extremo 1: forma bifurcada en  forma de hueso, donde la cresta A es de mayor tamaño que la cresta B. Largo de la cresta A: 25 mm.Largo de la cresta B: 22 mm.Apertura máxima: 17 mm.Extremo 2 forma cónica terminado en  punta: Largo total 35 mm.Apertura máxima o ancho. Largo de con o Ancho de cuelloAncho de vértice. Bolsa con 500', '' )   
